import React from 'react';
import { Box, Typography, Grid, Card, CardContent } from '@mui/material';
import Slider from 'react-slick';
import AgricultureIcon from '@mui/icons-material/Agriculture';
import NatureIcon from '@mui/icons-material/Nature';
import LocalFloristIcon from '@mui/icons-material/LocalFlorist';
import WaterDropIcon from '@mui/icons-material/WaterDrop';
import PetsIcon from '@mui/icons-material/Pets';
import OpacityIcon from '@mui/icons-material/Opacity';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

export default function PantallaInicio() {
  const secciones = [
    {
      imagen: '/imagenes/carrusel1.jpg',
      titulo: 'Ganadería responsable para alimentar al mundo',
      subtitulo: 'Cuidamos cada paso del proceso productivo'
    },
    {
      imagen: '/imagenes/carrusel2.jpg',
      titulo: 'La naturaleza nos da vida, nosotros la protegemos',
      subtitulo: 'Cultivamos con respeto por la tierra'
    },
    {
      imagen: '/imagenes/carrusel3.jpg',
      titulo: 'Sembramos futuro con cada semilla',
      subtitulo: 'Innovación desde el inicio del ciclo productivo'
    },
    {
      imagen: '/imagenes/carrusel4.jpg',
      titulo: 'Frutas frescas, sabor natural directo del campo',
      subtitulo: 'Calidad agrícola para todos'
    }
  ];

  const divisiones = [
    { nombre: 'Ganadería', color: '#8BC34A', icono: <PetsIcon fontSize="large" /> },
    { nombre: 'Cultivos', color: '#4CAF50', icono: <AgricultureIcon fontSize="large" /> },
    { nombre: 'Fertilizantes', color: '#FFEB3B', icono: <OpacityIcon fontSize="large" /> },
    { nombre: 'Semillas', color: '#009688', icono: <LocalFloristIcon fontSize="large" /> },
    { nombre: 'Acuacultura', color: '#03A9F4', icono: <WaterDropIcon fontSize="large" /> },
    { nombre: 'Natural', color: '#607D8B', icono: <NatureIcon fontSize="large" /> }
  ];

  const settings = {
    dots: true,
    infinite: true,
    autoplay: true,
    autoplaySpeed: 4000,
    arrows: false,
    pauseOnHover: false
  };

  return (
    <Box sx={{ width: '100%', mt: 2 }}>
      {/* 🌾 Carrusel institucional */}
      <Slider {...settings}>
        {secciones.map((item, index) => (
          <Box
            key={index}
            sx={{
              position: 'relative',
              height: '60vh',
              backgroundImage: `url(${item.imagen})`,
              backgroundSize: 'cover',
              backgroundPosition: 'center',
              overflow: 'hidden'
            }}
          >
            <Box
              sx={{
                position: 'absolute',
                inset: 0,
                backgroundColor: 'rgba(0, 0, 0, 0.35)',
                zIndex: 1
              }}
            />
            <Box
              sx={{
                position: 'absolute',
                top: 40,
                left: 60,
                zIndex: 2,
                color: '#fff',
                maxWidth: '60%'
              }}
            >
              <Typography variant="h4" sx={{ fontWeight: 'bold', textShadow: '2px 2px 4px #000' }}>
                {item.titulo}
              </Typography>
              <Typography variant="h6" sx={{ mt: 1, textShadow: '1px 1px 3px #000' }}>
                {item.subtitulo}
              </Typography>
            </Box>
          </Box>
        ))}
      </Slider>

      {/* 🧭 Divisiones tipo institucional horizontal */}
      <Box sx={{ px: 4, py: 6 }}>
        <Typography variant="h4" sx={{ fontWeight: 'bold', mb: 4 }} align="center">
          Nuestras Divisiones
        </Typography>

        <Grid container spacing={3}>
          {divisiones.map((div, index) => (
            <Grid item xs={12} md={6} key={index}>
              <Card
                sx={{
                  backgroundColor: div.color,
                  color: '#fff',
                  display: 'flex',
                  alignItems: 'center',
                  height: '100px',
                  boxShadow: 3,
                  px: 3,
                  '&:hover': {
                    transform: 'scale(1.01)',
                    transition: '0.3s'
                  }
                }}
              >
                {div.icono}
                <CardContent>
                  <Typography variant="h6">{div.nombre}</Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Box>
    </Box>
  );
}
